import React, {Component} from "react";

export class Work extends Component{
    render() {
        return(
            <section>
                <h1>WORK EXPERIENCE</h1>
                <form>
                    Company Name: <br /><input type="text" name="companyname" />
                    <br />
                    Postion Title: <br /><input type="text" name="positiontitle" />
                    <br />
                    Main Tasks: <br /><input type="textarea" name="maintasks" />
                    <br />
                    Begin Date: <br /><input type="date" name="begindate" />
                    <br />
                    End Date: <br /><input type="date" name="enddate" />
                </form>
            </section>
        )
    }
}
